    create_time: '2019-11-18',
    content: `<h1 class="ql-align-center">Store用法-state和getter</h1><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p>		最近同事要去做其他的项目，然后他之前一个项目要重新启动，所以我替他接手了该项目，看了下项目的stroe目录，如下</p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p>在getters下又有如下的部分代码</p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p>从他的store中大致看出了好几点问题，如下：</p><ol><li>没有按功能模块，即modules和namespaced来区分每个功能模块的，这样当项目越来越庞大了，store的状态也就越来越难维护</li><li>部分getters没必要写，完全可以用state即可</li><li>在actions，存在很多跟状态管理无关的函数，貌似很多只要是api请求都写到里面去了</li></ol><p><br></p><p>于是乎，我们可以引导出一个问题，我们应该如何去使用store状态管理工具</p><p><br></p><p>我觉得</p><ol><li>无论项目大小与否，都使用module和namespaced去区分每个模块</li><li>理解好state和getters的使用场景，别盲目的使用</li><li>actions中只写状态管理相关的数据，只与当前页面或者组件相关的写到组件自己的methods中</li><li>其实我不是很喜欢上面那种getters、state、mutations等分了好几个文件写的做法，所以还是尽量放在一个文件中，更好的管理吧</li><li>理解清楚vuex的相关api</li></ol><p><br></p>`
